import React from 'react';
import Posts from '../src/Pages/Posts.js';
import Header from '../src/Components/Header.js';
import { Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
   <Routes>
      <main>
        <Header />
        <Posts />
      </main>
   </Routes>
  );
}

export default App;
